import { Card, CardBody, CardTitle, CardSubtitle, Table } from "reactstrap";
import user1 from "../../assets/images/users/user1.jpg";
import user2 from "../../assets/images/users/user2.jpg";
import user3 from "../../assets/images/users/user3.jpg";
import user4 from "../../assets/images/users/user4.jpg";
import user5 from "../../assets/images/users/user5.jpg";

const tableData = [
  {
   // avatar: user1,
    name: "System1",
    email: "CentOS",
    project: "Flexy React",
    weeks: "35",
    budget: "95K",
    status: "N",
  },
  {
   // avatar: user2,
    name: "System2",
    email: "RedHat",
    project: "Lading pro React",
    weeks: "35",
    budget: "95K",
    status: "Y",
  },
  {
  //  avatar: user3,
    name: "System3",
    email: "Windows",
    project: "Elite React",
    weeks: "35",
    budget: "95K",
    status: "Y",
  },
  {
  //  avatar: user4,
    name: "System4",
    email: "MSSQL",
    project: "Flexy React",
    weeks: "35",
    budget: "95K",
    status: "N",
  },
  {
  //  avatar: user5,
    name: "System5",
    email: "Oracle",
    project: "Ample React",
    weeks: "35",
    budget: "95K",
    status: "N",
  },
];

const ProjectTables = () => {
  return (
    <div>
      <Card>
        <CardBody>
          <CardTitle tag="h5">Project Listing</CardTitle>
          <CardSubtitle className="mb-2 text-muted" tag="h6">
            Overview of the projects
          </CardSubtitle>

          <Table className="no-wrap mt-3 align-middle" Table bordered hover>
            <thead>
              <tr>
                <th></th>
                <th>시스템명</th>
                <th>시스템유형</th>
                <th>IP</th>
                <th>계정수</th>
                <th>동기화일자</th>
                <th>동기화여부</th>
              </tr>
            </thead>
            <tbody>
              {tableData.map((tdata, index) => (
                <tr key={index} className="border-top">
                  <td></td>
                  <td></td>
                  <td>
                    <div className="d-flex align-items-center p-2">
                      {/*<img*/}
                      {/*  src={tdata.avatar}*/}
                      {/*  className="rounded-circle"*/}
                      {/*  alt="avatar"*/}
                      {/*  width="45"*/}
                      {/*  height="45"*/}
                      {/*/>*/}
                      <div className="ms-3">
                        <h6 className="mb-0">{tdata.name}</h6>
                      </div>
                    </div>
                  </td>
                  <td>{tdata.email}</td>
                  <td>{tdata.project}</td>
                  <td>{tdata.weeks}</td>
                  <td>{tdata.budget}</td>
                  <td>
                    {tdata.status === "N" ? (
                        <span className="p-2 bg-danger rounded-circle d-inline-block ms-3"></span>
                    ) : (
                        <span className="p-2 bg-success rounded-circle d-inline-block ms-3"></span>
                    )}
                  </td>
                </tr>
              ))}
            </tbody>
          </Table>
        </CardBody>
      </Card>
    </div>
  );
};

export default ProjectTables;
